import React from 'react';
import { Switch, Route, Redirect } from 'react-router-dom';
import { Login, Password } from './Component/Component';

const App = () => {
  return (
    <>
      <Switch>
        <Route exact path="/" component={Login} />
        <Route exact path="/password-verification" component={Password} />
        <Redirect to="/email-verification" />
      </Switch>
    </>
  )
}

export default App
